	add("necklace", "{\"term\":\"necklace\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|neck|lace|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An article of jewelry that is worn around the neck, most often made of a string of precious metal, pearls, gems, beads or shells, and sometimes having a pendant attached\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anything resembling a necklace in shape\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027necklace\u0027\u0027 of coral islands\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A method of informal execution in which a rubber tyre is filled with petrol, placed around the victim\u0027s chest and arms, and set on fire\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"4 August, 2004\u0027\u0027 Headline Pretoria News: \u0027\u0027Necklacing: 7 held\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Seven people have been arrested in connection with Saturday\u0027s \u0026quot;\u0027\u0027necklace\u0027\u0027\u0026quot; murder of three men in the Tjokville informal settlement at Jeffrey\u0027s Bay\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027 Beyond Our Wildest Dreams: The United Democratic Front and the Transformation of South Africa by Ineke Van Kesse\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Several of the alledged witches in Apel and GaNkaone were also subjected to a \u0027\u0027necklace\u0027\u0027 execution\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 A Human Being Died That Night: A South African Woman Confronts the Legacy of Apartheid by Pumla Gobodo-Madikizel\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In the fluidly unfolding events of a \u0027\u0027necklace\u0027\u0027 murder, was there time and space to stop the killing\", \"priority\":10}]}, \"synonyms\":{}}");

	add("necklet", "{\"term\":\"necklet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|neck|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A necklac\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A type of ornament worn tightly about the neck\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027, w:P. L. P. L. Travers, w:Mary \u0027Mary Poppins\u0027, revised edition, chapter 4\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He was a dog—one of those small, silky, fluffy dogs that look like a fur \u0027\u0027necklet\u0027\u0027, until they begin to bark\", \"priority\":4}]}, \"synonyms\":{}}");

