	add("necrocracy", "{\"term\":\"necrocracy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|necro|cracy|t1\u003ddeath|t2\u003dpower, rule|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A government that still operates under the rules of a former, dead leader\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, w:Christopher Christopher Hitchens, \u0026quot;[http://www.vanityfair.com/politics/features/2001/01/hitchens-200101 Visit to a Small Planet]\u0026quot;, \u0027Vanity Fair\u0027, January 2001\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Kim Jong Il, incidentally, has been made head of the party and of the army, but the office of the presidency is still “eternally” held by his adored and departed dad, who died on July 8, 1994, at 82. (The Kim is dead. Long live the Kim.) This makes North Korea the only state in the world with a dead president. What would be the right term for this? A \u0027\u0027necrocracy\u0027\u0027? A thanatocracy? A mortocracy? A mausolocracy\", \"priority\":3}]}, \"synonyms\":{}}");

	add("necrohippoflagellation", "{\"term\":\"necrohippoflagellation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027νεκρός\u0027 (dead) + Ancient greek (to 1453) \u0027ἵππος\u0027 (horse) + English \u0027flagellation\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or practice of beating a dead horse\", \"priority\":1}]}, \"synonyms\":{}}");

