	add("necrohormone", "{\"term\":\"necrohormone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|necro|hormone|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a class of hormones, present in plant and animal tissue, that promotes healing after injury\", \"priority\":1}]}, \"synonyms\":{}}");

