	add("necrology", "{\"term\":\"necrology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|necro|logy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A church register containing the names of those connected with the church who have died\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A listing of people who have died during a specific period of time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, p. 366\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Voltaire and Rousseau died in 1778, d\u0027Alembert in 1783, and Diderot in 1784, while leading salonnières Mesdames du Deffand and d\u0027Épinay passed away in 1780 and 1783. Beneath this sombre \u0027\u0027necrology\u0027\u0027, important shifts were occurring in the workings of the public sphere and in the sites in which opinion was constructed\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 Marc Fisher; We Loved That Airline To Death; Washington Pos\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The fare structure is one reason Independence Air has joined a \u0027\u0027necrology\u0027\u0027 of low-cost carriers that stretches over four decades\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A notice of death; an obituary\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The study of death or the dead\", \"priority\":8}]}, \"synonyms\":{}}");

	add("necrolysis", "{\"term\":\"necrolysis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{etystub|en}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The disintegration and exfoliation of necrotic tissue\", \"priority\":1}]}, \"synonyms\":{}}");

	add("necromancy", "{\"term\":\"necromancy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Circa 1300, from Old french (842-ca. 1400) \u0027nigromancie\u0027 from \u0027nigromantia\u0027 from Latin \u0027necromantia\u0027 from Ancient greek (to 1453) \u0027νεκρομαντεία\u0027 \u0027νεκρός\u0027 (dead) + \u0027μαντεία\u0027 (divination) Medieval Latin spelling, incorporating nige. Latin|niger (\u0027black\u0027), influenced by the notion of black_art|black art. Modern spelling adopted in mid-1500s.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Divination involving the dead or death\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1597\u0027\u0027 King James Daemonologi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And for to make this treatise the more pleasaunt and facill, I have put it in forme of a Dialogue, which I have diuided into three bookes: The first speaking of Magie in general, and \u0027\u0027Necromancie\u0027\u0027 in special\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1652\u0027\u0027 Gaule The Magastromance\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And in one word for all, \u0027\u0027Nagomancy\u0027\u0027, or \u0027\u0027Necromancy\u0027\u0027; by inspecting, consulting, and divining by, with, or from the dead\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1867\u0027\u0027 E. Rogers, quoted in K. Thomas Relig. \u0026amp; Decline of Magi\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"the Devil did often tempt me to study \u0027\u0027necromancy\u0027\u0027 and \u0027\u0027nigromancy\u0027\u0027 and to make use of magic, and to make a league with him\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027 L. Spence Encyc. Occul\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"There is no doubt..that \u0027\u0027necromancy\u0027\u0027 is the touch-stone of occultism\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Loosely, any sorcery or witchcraft, especially involving death or the dead, particularly sorcery involving raising or reanimating the dead\", \"priority\":10}]}, \"synonyms\":{}}");

	add("necrophagia", "{\"term\":\"necrophagia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|necro|phagia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the consumption of dead flesh or carrio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the practice of feeding on (eating) corpses\", \"priority\":2}]}, \"synonyms\":{}}");

