	add("necrophilia", "{\"term\":\"necrophilia\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027\u0027 (Ancient greek (to 1453) \u0027νεκρός\u0027 (corpse, dead) + \u0027\u0027 (Ancient Greek \u0027φιλία\u0027 (affection) , after German \u0027nekrophilie\u0027 (in Krafft-Ebing 1887).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pathological attraction to dead bodies, especially sexual attraction or intercourse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Pathological fascination with death\", \"priority\":2}]}, \"synonyms\":{}}");

