	add("necropolis", "{\"term\":\"necropolis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027νεκρόπολις\u0027 (city of the dead) from \u0027νεκρός\u0027 (dead) + \u0027πόλις\u0027 (city)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large cemetery, especially one of elaborate construction in an ancient city\", \"priority\":1}]}, \"synonyms\":{}}");

