	add("nectar", "{\"term\":\"nectar\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027nectar\u0027 from Ancient greek (to 1453) \u0027νέκταρ\u0027 (nourishment of the gods) from \u0027νέκ\u0027 (death) (see \u0027necro-\u0027 + \u0027ταρ\u0027 (overcoming) from Proto-indo-european {{m|ine-pro|*nek-|*neḱ-|perish, disappear}} + {{m|ine-pro|*-tr̥h₂||overcoming}}, from {{m|ine-pro|*terh₂-||to overcome, pass through, cross over}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The drink of the gods\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, \u0027The Faerie Queene\u0027, III.4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They pourd in soveraine balme and \u0027\u0027Nectar\u0027\u0027 good, / Good both for erthly med\u0027cine and for hevenly food\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any delicious drink, now especially a type of sweetened fruit juice\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The sweet liquid secreted by flowers to attract pollinating insects and birds\", \"priority\":5}]}, \"synonyms\":{}}");

